import http from "../http-common";
//import { Body } from '@nestjs/common';

class UserDataService {
  getImage(id) {
    return http.get(`/img/${id}.png`);
  }
  getAns(_id, _input) {
    return http.post('/ans',{pid:_id, input: _input});
  }
  endUser(_name,_id,_phone) {
    return http.post('/end_user',{name : _name, id: _id, phone :_phone});
  }
}

export default new UserDataService();
